The Shayzien '''sergeants''' can be found outside the entrance of the [[Farming Guild]], along with two [[Soldier (Kebos Lowlands)|soldiers]] and a [[Ranger (Kebos Lowlands)|ranger]]. They can also be found by the two bridges in [[Gordon]] and [[Keith]]'s farms by the [[River Molch]] that lead into the [[Kebos Swamp]].

When talked to, he explains that it is his job to defend the fertile land from possible [[lizardmen]] attacks from across River Molch, though they are only a few soldiers on duty, as the lizardmen currently seem to be focusing their efforts in the [[Battlefront]] east of the area.

He plays a minor role in the quest [[Getting Ahead]], where he tells players that they can't help [[Gordon]] and [[Mary (Getting Ahead)|Mary]] as their focus is on the [[lizardmen]]. Players could also ask him about [[Sophia Hughes]] in the investigation of her escape during [[A Kingdom Divided]].

